  tasksForPatient(patientId: $patientId, pageNumber: $pageNumber, pageSize: $pageSize, orderBy: $orderBy) {
    edges {
      node {
        ...FullTask
      }
    }
    pageInfo {
      hasPreviousPage
      hasNextPage
    }
  }
}

